"use strict";function wmHide(e){document.querySelector(e)&&(document.querySelector(e).style.display="none")}function wmRemove(e){document.querySelector(e)&&document.querySelector(e).remove()}function wmWaitAndHide(e){setTimeout((()=>{wmHide(e)}),2e3)}function wmWaitAndRemove(e){setTimeout((()=>{wmRemove(e)}),2e3)}function wmWaitWaitAndRemove(e){setTimeout((()=>{wmRemove(e)}),4e3)}function wmHideAll(e){document.querySelectorAll(e).forEach((e=>{e.style.display="none"}))}function wmRemoveAll(e){document.querySelectorAll(e).forEach((e=>{e.remove()}))}function wmHideAllInStyle(e){wmAddNewStyle(e+" {display: none;}")}function wmHideAllInStyleImportant(e){wmAddNewStyle(e+" {display: none !important;}")}function wmClick(e){document.querySelector(e)&&document.querySelector(e).click()}function wmClickLast(e){if(document.querySelector(e)){let t=document.querySelectorAll(e);t[t.length-1].click()}}function wmClickNumber(e,t){document.querySelector(e)&&document.querySelectorAll(e)[t-1].click()}function wmAddNewStyle(e){e=e.replace(/(\n|\t)/g,"");let t=document.createElement("style");t.innerText=e,document.head.appendChild(t)}function wmCloseTab(){window.open("https://vash.omnimir.ru/tabautoclose/","_self")}function wmWaitAndCloseTab(){setTimeout((()=>{wmCloseTab()}),2e3)}
